    "2016-07-27T22:46:20.171242",nt"name": "hydrogeomorphic-evaluation-of-ecosystem-restoration-and-management-options-for-alamosa-nat",nt"isopen":
    false,nt"url": null,nt"notes": "This Evaluation of Ecosystem Restoration
    and Management Options covers the hydrogeomorphic analysis (HGM) for the Alamosa
    National Wildlife Refuge (NWR). This three step process outlines the historical
    landscape, contemporary changes from presettlement conditions, restoration and management
    options and monitoring and evaluation needs for within wetland and upland areas
    in the San Luis Valley. Topics include geomorphology, soils, topography/elevation,
    climate and hydrology. This report provides a hydrogeomorphic (HGM) evaluation of
    ecosystem restoration and management options for the Alamosa National Wildlife Refuge
    (NWR). Objectives of the report are:1. Describe the pre-European settlement (hereafter
    Pre-settlement) ecosystem condition and ecological processes occurring along the
    Rio Grande in the San Luis Valley near and within the refuge. 2. Document changes
    in the San Luis Valley regional ecosystem from the Pre-settlement period with specific
    reference to alterations in hydrology, vegetation community structure and distribution,
    and resource availability to key fish and wildlife species.3. Identify restoration
    and management options incorporating ecological attributes needed to restore specific
    habitats and conditions within Alamosa NWR.",nt"license_title": "License Not
